  useEffect(() => {
    setWords(generateWords())
  }, [])  

  function generateWords (){
    return new Array(NUMB_OF_WORDS).fill(null).map(() => randomWords())
  }

  return (
    <div className="App">
      <div className="section">
        <div className="card">
          <div className="card-content">
            
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
